/* Default */
import React from 'react'

/* Packages */
import { NormalizeCss, Box, Flex } from 'react-bee'

const App = () => {
  return (
    <>
      <NormalizeCss />
      <Box>
        <Flex style={{ background: 'red' }} justifyContent='' gridGap='' flexWrap="wrap">
          <>
            {Array(9999)
              .fill()
              .map((empty, i) => (
                <TestTrack index={i} background={`#${Math.floor(Math.random()*16777215).toString(16)}`} />
              ))}
          </>
        </Flex>
      </Box>
    </>
  )
}

export default App

const TestTrack = ({ index, background }) => (
  <div style={{ background: background, padding: '10px', flex: '25% 1 auto' }}>{index}</div>
)
